		//BOOKSHELVES VIEWER: set background color scales on counters
		_bookshelvesViewer_setColorScaleOnCounters=function(){
            for (var iCycle=1;iCycle<6;iCycle++){
				_colorsScale_setBackgroundOnElements(
				    iCycle===1 ? _BSD.f.SHELVES.DOMcontainer.find('.userShelf .samoShelfCounter:visible')
					   : iCycle===2 ? $('.samoFilterYear .samoShelfCounter')
					   : iCycle===3 ? $('.samoFilterMonth .samoShelfCounter')
					   : iCycle===4 ? $('.samoFilterRating .samoShelfCounter')
					   :              $('.samoFilterNumpages .samoShelfCounter'),
					iCycle===1 ? 1
					           : 0,		//don't consider firt shelf ("read" or "to-read")
					{}
				);
            }
		}

		//BOOKSHELVES VIEWER: create logs for "Num.pages" filters collected (because some books num.pages could not be corrected)
		_bookshelvesViewer_layoutLogNumPages=function(){
			var html='<table>',
			    book,
			    reason,
			    numPagesOLD,
			    numPagesNEW;

			if (!_BSD.booksSearchNumPagesOnAnotherEdition.length){return;}
            setTimeout(function(){
				$('#samoNumPagesLogButton').show();
			},0);
			
			//title row
			html+='<thead>';
			html+='<tr>';
			html+='<th><a id="samoNumPagesLogToggleRowButton" onclick="jQuery(\'#samoNumPagesLogDetail\').toggleClass(\'expanded\')"><span class="textHide">Hide</span><span class="textShow">Show</span> book updated</a>Title</th>';
			html+='<th>Author</th>';
			html+='<th>Reason</th>';
			html+='<th>Num.pages (OLD)</th>';
			html+='<th>(NEW)</th>';
			html+='</tr>';
			html+='</thead>';

			//rows
			html+='<tbody>';
			for (var i=0;i<_BSD.booksSearchNumPagesOnAnotherEdition.length;i++){    //for every year (ascending)
			    book=_BSD.books[_BSD.booksSearchNumPagesOnAnotherEdition[i]];

			    reason=[];
			    if (book.el.data('shelves').indexOf('f_audiobook')>-1){reason.push('audiobook');}
			    if (book.el.data('numpagesOLD')==0){reason.push('undefined pages');}
			    numPagesOLD=book.el.data('numpagesOLD');
			    numPagesNEW=book.el.data('numpages');

				html+='<tr'+(numPagesOLD===undefined ? ' class="numPagesNotFound"' : '')+'>';

				//Title
				html+='<td><a href="'+book.url+'" target="_blank">'+book.el.data('title')+'</a></td>';
				//Author
				html+='<td>'+book.el.data('author')+'</td>';
				//Reason
				html+='<td>'+reason.join(', ')+'</td>';
				//Num.pages (OLD\NEW)
				if (numPagesOLD===undefined){
					html+='<td>'+numPagesNEW+'</td>';
					html+='<td>not found</td>';
				}else{
					html+='<td>'+numPagesOLD+'</td>';
					html+='<td><a href="'+book.el.data('numpagesNEW_url')+'" title="'+book.el.data('numpagesNEW_title')+'" target="_blank">'+numPagesNEW+'</a></td>';
				}
				html+='</tr>';
			}
			html+='</tbody>';
			html+='</table>';
            return html;
		},

